import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import DetailBooking from "../src/page/detailBooking";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/bookings/thisweek">
            <DetailBooking />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
